con:testCase.con:setupScript:
// read the property as a string
def uniqueUserPortion = testRunner.testCase.testSuite.project.getPropertyValue("uniqueUserPortion")
def uniqueUserEmail = testRunner.testCase.testSuite.project.getPropertyValue("newUserEmail")
// convert it to an Integer, and increment
def uniqueUserPortionInc = uniqueUserPortion.toInteger() + 1
// set the property back as string
testRunner.testCase.testSuite.project.setPropertyValue("uniqueUserPortion", uniqueUserPortionInc.toString())
testRunner.testCase.testSuite.project.setPropertyValue("newUserEmail", "testEmail" + uniqueUserPortionInc.toString() + "@gmail.com")
testRunner.testCase.testSuite.project.setPropertyValue("newUserEmail2", "testEmail2" + uniqueUserPortionInc.toString() + "@test.com")
testRunner.testCase.testSuite.project.setPropertyValue("newUserEmail3", "testEmail3" + uniqueUserPortionInc.toString() + "@domain.com")
testRunner.testCase.testSuite.project.setPropertyValue("newUserEmail4", "testEmail4" + uniqueUserPortionInc.toString() + "@update.com")
// check
log.info testRunner.testCase.testSuite.project.getPropertyValue("uniqueUserPortion")

